package STRING;

public class STRING_SWAP {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
System.out.println("before swaping");
int a=100;
int b=200;
System.out.println("a = "+a);
System.out.println("b = "+b);	
System.out.println("after swaping");	
int s;
s=a;
a=b;
b=s;
System.out.println("a = "+a);
System.out.println("b = "+b);	
	}

}
